import React from "react";
import Intro from "../components/Intro/Intro.js";
import Section from '../components/Section/Section.js';

import { projectProps } from '../components/data/Data.js'

import AffinityDiagram from './TripPicMedia/AffinityDiagram.png';
import CustomerJourneyMap from './TripPicMedia/CustomerJourneyMap.png';
import UserFlow from './TripPicMedia/UserFlow.png'
import Crazy8s from './TripPicMedia/Crazy8s.png'
import SpeedDating from './TripPicMedia/SpeedDating.png'
import ConceptModel from './TripPicMedia/ConceptModel.png'
import Wireframes from './TripPicMedia/Wireframes.png'

function TripPic() {

    const item = projectProps('trip_pic');

    return (
        <div className="body">
            <Intro 
                key={ item.Component }
                component={ item.Component }
                title={ item.Title }
                highlight={ item.Highlight }
                tags={ item.Tags }
                dates={ item.Dates }
                summary={ item.Summary }
                link={ item.Link }
                linkTitle={ item.LinkTitle }
                responsibilities={ item.Responsibilities }
                tools={ item.Tools }
                team={ item.Team }
            />
            <Section 
                title="Problem Space"
            >
                <h3>How do we improve young adult’s adoption of cybersecurity tools?</h3>
                <br></br>
                <p>
                    Young adults are seeking help online for how they can “get their life together,” but cybersecurity doesn’t appear in any existing self-development guides. This is more surprising when you consider that roughly 2/3 of U.S. Internet users are estimated to have experienced data theft of some kind and over half of U.S. Internet users surveyed have expressed wanting to do more protect their online security and privacy.<br/><br/>
                    Despite these sentiments, as well as attempts to raise the security sensitivity of the general populace, expert’s advice on cybersecurity is largely ignored and general knowledge remains low.
                </p>
            </Section>

        </div>
    )
}

export default TripPic;
